import React from "react";
import { Table } from 'reactstrap';


const WorkoutWeekTable = ({workouts}) => {

    const tableStyle = {
        height: '100%',
        marginTop: '50px',
        tableLayout: 'fixed'
    };

    const tableDataStyle = {
        width: '10%',
        fontSize: '10px'
    };

    return (
        <Table bordered responsive style={tableStyle}>
            <thead>
            <tr>
                <th style={tableDataStyle}>Mo</th>
                <th style={tableDataStyle}>Tu</th>
                <th style={tableDataStyle}>We</th>
                <th style={tableDataStyle}>Th</th>
                <th style={tableDataStyle}>Fr</th>
                <th style={tableDataStyle}>Sa</th>
                <th style={tableDataStyle}>Su</th>
            </tr>
            </thead>
            <tbody>
            <tr>
                {workouts.map(workout => <td style={tableDataStyle} key={ workout.id }> {workout.name}
                    {workouts.map(workout => {workout.exercises.map(exercise => <span>{exercise.name}<br></br></span>)})}
                </td>)}
            </tr>
            </tbody>
        </Table>

    )
}

export default WorkoutWeekTable;


